图1.2是第一次到货，2号色腮红是非塑封的，外包装很脏，只用贴纸贴着。于是我申请换货
图3-7是新换的，我换货时备注要塑封的，还是给我换了这种，客服回复是新旧包装混发且没得选&hellip;
于是我打开看看，对比看就很明显，粉的是10号色，散粉边缘整齐光滑，散粉是平的。深沉一点的是2号色，边缘凹凹凸凸不齐整，且外圈是凹进去的&hellip;不是平的&hellip;尺寸一致 凹进去的话粉量会相对少了&hellip;不知道是不是别人的退换货重新压盘&hellip;但是客服说了是旧包装&hellip;那我有啥可说的&hellip;姐妹们自行判断再买哈

